import React from 'react';

const ActiveUsers = ({ activeUsers, onUserClick }) => {
  // Check if activeUsers is undefined or null
  if (!activeUsers) {
    return <div>No active users</div>;
  }

  return (
    <ul>
      {activeUsers.map((user) => (
        <li key={user} onClick={() => onUserClick(user)} style={{ cursor: 'pointer' }}>
          {user}
        </li>
      ))}
    </ul>
  );
};

export default ActiveUsers;
